import { useEffect } from 'react';
import { appTitle } from '../globals/globals';

const PageAbout = () => {

    useEffect(() => {
        document.title = `${appTitle} - About`;
    }, []);

    return (
        <main>
            <section className="creative-journey">
                <h3>Hello</h3>

            </section>
        </main>
    );

};

export default PageAbout;
